import React from "react";

// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  FormGroup,
  Form,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Modal,
  Row,
  Col,
} from "reactstrap";

// core components
import DemoNavbar from "components/Navbars/DemoNavbar.js";
import SimpleFooter from "components/Footers/SimpleFooter.js";

class Theory extends React.Component {
  componentDidMount() {
    document.documentElement.scrollTop = 0;
    document.scrollingElement.scrollTop = 0;
    this.refs.main.scrollTop = 0;
    
  }
  state = {
    defaultModal: false
  };
  toggleModal = state => {
    this.setState({
      [state]: !this.state[state]
    });
  };
  render() {
    return (
      <>
        <DemoNavbar />
        <main ref="main">
          <section className="section section-shaped section-lg">
            <div className="shape shape-style-1 bg-gradient-default">
              <span />
              <span />
              <span />
              <span />
              <span />
              <span />
              <span />
              <span />
            </div>
           
            <Container>
              <Row>
                <Col md="6">
                  <Row>
                    <Col md="1" className="mb-6 mt-6">
                      <img src="https://i.pinimg.com/originals/fa/f5/e7/faf5e7bd42e5829c5cd63517459844d0.png"  /> 
                    </Col>
                    <Col md="10" className="mb-6">
                      <img src="https://i.pinimg.com/originals/fa/f5/e7/faf5e7bd42e5829c5cd63517459844d0.png"  />
                    </Col>
                  </Row>
                  
                  <Row>
                    <Col md="10" className="mb-6">
                      <img src="https://i.pinimg.com/originals/fa/f5/e7/faf5e7bd42e5829c5cd63517459844d0.png"  />
                    </Col>
                    <Col md="10" className="mb-6">
                      <img src="https://i.pinimg.com/originals/fa/f5/e7/faf5e7bd42e5829c5cd63517459844d0.png"  />
                    </Col>
                  </Row>
                </Col>
              </Row>
            </Container>
          
          </section>
        </main>
        <SimpleFooter />
      </>
    );
  }
}

export default Theory;
